import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

import Apartado from '../components/Apartado';

export default () =>  {

    const [apartados, setApartados] = useState([]);

    const apiUrl = 'https://api.example.com/names';

    useEffect(() => {
        const fetchData = async () => {
        try {
            const response = await axios.get('https://finanzas.visssible.com/backend/apartados-consultar.php?');
            setApartados(response.data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
        };

        fetchData();
    }, []); // The empty dependency array ensures that this effect runs once on mount


    return (
        <>

            <Link to="/budget">Budget</Link>

            <ul id="apartados">
                {apartados.map(apartado => (
                <Apartado key={apartado.id} name={apartado.nombre} ammount={apartado.saldo} icon={apartado.icono} distribution={apartado.reparticion}/>
                ))}
            </ul>

        </>
    );

}
